import React, { useState }from "react";
import { BrowserRouter as Router, Switch, Route, } from "react-router-dom";
import { data }  from './data/data';

function App() {
  const [account, setAccount]= useState(data.account);

  return (
    <Router>
      <Switch>
        {!account.loggedIn ? (
          <Route path="/">
          <h1>Login</h1>
        </Route>
        ) : {}}
        <Route path="/login">
          <h1>Login</h1>
        </Route>
        <Route path="/">
          <h1>Neewsfeed</h1>
        </Route>
        <Route path="/:userId">
          <h1>User page</h1>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
